	["Given my visa was temporary i didnt expect for it to be extended. I decreatureed to take it from there and live in this place, not Kansas."] = "Ze wzgledu na to, ze moja wiza byla czasowa, nie liczylem na jej przedluzenie. Postanowilem, ze jednak zamieszakam tutaj, a nie w kansas.",
