	["He didnt tolerate my refusal and with one swing it killed {Date} and {Gucci}"] = "Mojej odmowy nie potraktowal ulgowo i jednym ciosem zgladzil {Daktyla} i {Gucia}. Reszte zdolalem ocalic, a dziwna istota uciekla.",
	["s teeth. With his experience he could fill children coloring books."] = "Gucio byl moim ulubionym zwierzakiem. Byl wyjatkowo inteligentny, i potrafil malowac obrazy pedzlem, trzymajac go w zebach. Po jakims czasie doszedl do wiekszej wprawy, i potrafil wypelniac kolorowanki dla dzieci.",
	["If i recall correctly, Date was the fastest dromedary i ever saw. I think that i was to compete in equestrian competition, i would pick him."] = "Jezeli dobrze pamietam, to Daktyl byl najszybszym wielbladem, jakiego widzialem. Myslalem, ze gdybym startowal w wyscigach jezdzieckich, to wlasnie jego bym wybral do pomocy.",
